import React from "react";

export default ({task}) => {
    return (
        <form>
            <div className='form-group card mb-4'>
                <div className='card-title text-center mt-2'> {task}</div>
                    <div className='card-body'>
                        <input
                        size={2}
                        />
                    </div>
                </div>
        </form>
    )
}
